import React from 'react';
import { ResponsiveLine } from '@nivo/line';
import { ResponsiveBar } from '@nivo/bar';
import { ResponsiveArea } from '@nivo/area';
import './EngineeringCharts.css';

const chartColors = [
  '#7367f0', '#28c76f', '#ff9f43', '#ea5455', '#00cfe8'
];

// Helper to prepare data for multi-parameter charts
const prepareStageTrendData = (data) => {
  // Group by stage
  const grouped = {};
  data.forEach(row => {
    const stage = row.stage || 'Unknown';
    if (!grouped[stage]) grouped[stage] = [];
    grouped[stage].push(row);
  });
  
  // Calculate averages for each parameter per stage
  const stageData = Object.entries(grouped).map(([stage, rows]) => {
    const avgArea = rows.reduce((sum, r) => sum + (parseFloat(r.area_um2) || 0), 0) / rows.length;
    const avgInternalTiming = rows.reduce((sum, r) => sum + (parseFloat(r.internal_timing) || 0), 0) / rows.length;
    const avgUtilization = rows.reduce((sum, r) => sum + (parseFloat(r.utilization) || 0), 0) / rows.length;
    const avgInterfaceTiming = rows.reduce((sum, r) => sum + (parseFloat(r.interface_timing) || 0), 0) / rows.length;
    const avgCongestion = rows.reduce((sum, r) => sum + (parseFloat(r.congestion_drc_metrics) || 0), 0) / rows.length;
    
    return {
      stage,
      area: avgArea,
      internalTiming: avgInternalTiming,
      utilization: avgUtilization,
      interfaceTiming: avgInterfaceTiming,
      congestion: avgCongestion
    };
  });
  
  return stageData;
};

const EngineeringCharts = ({ data }) => {
  const stageData = prepareStageTrendData(data);
  
  // Prepare data for different chart types
  const lineChartData = [
    {
      id: 'Area (um¬≤)',
      color: chartColors[0],
      data: stageData.map(item => ({ x: item.stage, y: item.area }))
    },
    {
      id: 'Internal Timing',
      color: chartColors[1],
      data: stageData.map(item => ({ x: item.stage, y: item.internalTiming }))
    },
    {
      id: 'Utilization (%)',
      color: chartColors[2],
      data: stageData.map(item => ({ x: item.stage, y: item.utilization }))
    },
    {
      id: 'Interface Timing',
      color: chartColors[3],
      data: stageData.map(item => ({ x: item.stage, y: item.interfaceTiming }))
    },
    {
      id: 'Congestion/DRC',
      color: chartColors[4],
      data: stageData.map(item => ({ x: item.stage, y: item.congestion }))
    }
  ];

  const barChartData = stageData.map(item => ({
    stage: item.stage,
    area: item.area,
    internalTiming: item.internalTiming,
    utilization: item.utilization,
    interfaceTiming: item.interfaceTiming,
    congestion: item.congestion
  }));

  return (
    <div className="engineering-charts-container">
      <div className="engineering-charts-grid">
        
        {/* Line Chart - All Parameters Trends */}
        <div className="engineering-chart-card">
          <h4>üìà Parameter Trends by Stage</h4>
          <div className="engineering-chart-inner">
            <ResponsiveLine
              data={lineChartData}
              margin={{ top: 30, right: 30, bottom: 60, left: 60 }}
              xScale={{ type: 'point' }}
              yScale={{ type: 'linear', min: 'auto', max: 'auto' }}
              axisTop={null}
              axisRight={null}
              axisBottom={{
                tickSize: 5,
                tickPadding: 5,
                tickRotation: -30,
                legend: 'Stage',
                legendPosition: 'middle',
                legendOffset: 40,
              }}
              axisLeft={{
                tickSize: 5,
                tickPadding: 5,
                tickRotation: 0,
                legend: 'Value',
                legendPosition: 'middle',
                legendOffset: -50,
              }}
              pointSize={8}
              pointColor={{ theme: 'background' }}
              pointBorderWidth={2}
              pointBorderColor={{ from: 'serieColor' }}
              pointLabelYOffset={-12}
              useMesh={true}
              legends={[
                {
                  anchor: 'top',
                  direction: 'row',
                  justify: false,
                  translateX: 0,
                  translateY: -20,
                  itemsSpacing: 0,
                  itemDirection: 'left-to-right',
                  itemWidth: 80,
                  itemHeight: 20,
                  itemOpacity: 0.75,
                  symbolSize: 12,
                  symbolShape: 'circle',
                  symbolBorderColor: 'rgba(0, 0, 0, .5)',
                  effects: [
                    {
                      on: 'hover',
                      style: {
                        itemBackground: 'rgba(0, 0, 0, .03)',
                        itemOpacity: 1
                      }
                    }
                  ]
                }
              ]}
              theme={{
                axis: {
                  ticks: { text: { fill: '#b4b7bd' } },
                  legend: { text: { fill: '#b4b7bd' } },
                },
                legends: { text: { fill: '#b4b7bd' } },
                tooltip: { container: { background: '#fff', color: '#222' } },
              }}
            />
          </div>
        </div>

        {/* Bar Chart - All Parameters Comparison */}
        <div className="engineering-chart-card">
          <h4>üìä Parameter Comparison by Stage</h4>
          <div className="engineering-chart-inner">
            <ResponsiveBar
              data={barChartData}
              keys={['area', 'internalTiming', 'utilization', 'interfaceTiming', 'congestion']}
              indexBy="stage"
              margin={{ top: 30, right: 30, bottom: 60, left: 60 }}
              padding={0.3}
              groupMode="grouped"
              colors={chartColors}
              axisBottom={{
                tickSize: 5,
                tickPadding: 5,
                tickRotation: -30,
                legend: 'Stage',
                legendPosition: 'middle',
                legendOffset: 40,
              }}
              axisLeft={{
                tickSize: 5,
                tickPadding: 5,
                tickRotation: 0,
                legend: 'Value',
                legendPosition: 'middle',
                legendOffset: -50,
              }}
              labelSkipWidth={12}
              labelSkipHeight={12}
              legends={[
                {
                  dataFrom: 'keys',
                  anchor: 'top',
                  direction: 'row',
                  justify: false,
                  translateX: 0,
                  translateY: -20,
                  itemsSpacing: 2,
                  itemWidth: 100,
                  itemHeight: 20,
                  itemDirection: 'left-to-right',
                  itemOpacity: 0.85,
                  symbolSize: 20,
                  effects: [
                    {
                      on: 'hover',
                      style: {
                        itemOpacity: 1
                      }
                    }
                  ]
                }
              ]}
              theme={{
                axis: {
                  ticks: { text: { fill: '#b4b7bd' } },
                  legend: { text: { fill: '#b4b7bd' } },
                },
                legends: { text: { fill: '#b4b7bd' } },
                tooltip: { container: { background: '#fff', color: '#222' } },
              }}
            />
          </div>
        </div>

        {/* Area Chart - Utilization Focus */}
        <div className="engineering-chart-card">
          <h4>üìà Utilization Trends by Stage</h4>
          <div className="engineering-chart-inner">
            <ResponsiveArea
              data={[
                {
                  id: 'Utilization',
                  color: chartColors[2],
                  data: stageData.map(item => ({ x: item.stage, y: item.utilization }))
                }
              ]}
              margin={{ top: 30, right: 30, bottom: 60, left: 60 }}
              xScale={{ type: 'point' }}
              yScale={{ type: 'linear', min: 0, max: 'auto' }}
              axisTop={null}
              axisRight={null}
              axisBottom={{
                tickSize: 5,
                tickPadding: 5,
                tickRotation: -30,
                legend: 'Stage',
                legendPosition: 'middle',
                legendOffset: 40,
              }}
              axisLeft={{
                tickSize: 5,
                tickPadding: 5,
                tickRotation: 0,
                legend: 'Utilization (%)',
                legendPosition: 'middle',
                legendOffset: -50,
              }}
              enableGridX={false}
              enablePoints={true}
              pointSize={8}
              pointColor={{ theme: 'background' }}
              pointBorderWidth={2}
              pointBorderColor={{ from: 'serieColor' }}
              enableArea={true}
              areaOpacity={0.6}
              areaBlendMode="multiply"
              theme={{
                axis: {
                  ticks: { text: { fill: '#b4b7bd' } },
                  legend: { text: { fill: '#b4b7bd' } },
                },
                tooltip: { container: { background: '#fff', color: '#222' } },
              }}
            />
          </div>
        </div>

        {/* Bar Chart - Area Analysis */}
        <div className="engineering-chart-card">
          <h4>üìê Area Analysis by Stage</h4>
          <div className="engineering-chart-inner">
            <ResponsiveBar
              data={stageData.map(item => ({ stage: item.stage, area: item.area }))}
              keys={['area']}
              indexBy="stage"
              margin={{ top: 30, right: 30, bottom: 60, left: 60 }}
              padding={0.3}
              colors={chartColors[0]}
              axisBottom={{
                tickSize: 5,
                tickPadding: 5,
                tickRotation: -30,
                legend: 'Stage',
                legendPosition: 'middle',
                legendOffset: 40,
              }}
              axisLeft={{
                tickSize: 5,
                tickPadding: 5,
                tickRotation: 0,
                legend: 'Area (um¬≤)',
                legendPosition: 'middle',
                legendOffset: -50,
              }}
              theme={{
                axis: {
                  ticks: { text: { fill: '#b4b7bd' } },
                  legend: { text: { fill: '#b4b7bd' } },
                },
                tooltip: { container: { background: '#fff', color: '#222' } },
              }}
            />
          </div>
        </div>

        {/* Line Chart - Timing Analysis */}
        <div className="engineering-chart-card">
          <h4>‚è±Ô∏è Timing Analysis by Stage</h4>
          <div className="engineering-chart-inner">
            <ResponsiveLine
              data={[
                {
                  id: 'Internal Timing',
                  color: chartColors[1],
                  data: stageData.map(item => ({ x: item.stage, y: item.internalTiming }))
                },
                {
                  id: 'Interface Timing',
                  color: chartColors[3],
                  data: stageData.map(item => ({ x: item.stage, y: item.interfaceTiming }))
                }
              ]}
              margin={{ top: 30, right: 30, bottom: 60, left: 60 }}
              xScale={{ type: 'point' }}
              yScale={{ type: 'linear', min: 'auto', max: 'auto' }}
              axisTop={null}
              axisRight={null}
              axisBottom={{
                tickSize: 5,
                tickPadding: 5,
                tickRotation: -30,
                legend: 'Stage',
                legendPosition: 'middle',
                legendOffset: 40,
              }}
              axisLeft={{
                tickSize: 5,
                tickPadding: 5,
                tickRotation: 0,
                legend: 'Timing',
                legendPosition: 'middle',
                legendOffset: -50,
              }}
              pointSize={8}
              pointColor={{ theme: 'background' }}
              pointBorderWidth={2}
              pointBorderColor={{ from: 'serieColor' }}
              useMesh={true}
              legends={[
                {
                  anchor: 'top',
                  direction: 'row',
                  justify: false,
                  translateX: 0,
                  translateY: -20,
                  itemsSpacing: 0,
                  itemDirection: 'left-to-right',
                  itemWidth: 80,
                  itemHeight: 20,
                  itemOpacity: 0.75,
                  symbolSize: 12,
                  symbolShape: 'circle',
                  symbolBorderColor: 'rgba(0, 0, 0, .5)',
                  effects: [
                    {
                      on: 'hover',
                      style: {
                        itemBackground: 'rgba(0, 0, 0, .03)',
                        itemOpacity: 1
                      }
                    }
                  ]
                }
              ]}
              theme={{
                axis: {
                  ticks: { text: { fill: '#b4b7bd' } },
                  legend: { text: { fill: '#b4b7bd' } },
                },
                legends: { text: { fill: '#b4b7bd' } },
                tooltip: { container: { background: '#fff', color: '#222' } },
              }}
            />
          </div>
        </div>

      </div>
    </div>
  );
};

export default EngineeringCharts;
